      return {};
    }
  }

  /**
   * å®‰å…¨çš„Latin-1è§£ç  - é€å­—èŠ‚å¤„ç†ï¼Œæ°¸ä¸æˆªæ–­
   */
  decodeLatin1(data) {
    let result = '';
    for (let i = 0; i < data.length; i++) {
      result += String.fromCharCode(data[i]);
    }
    return result;
  }

  /**
